import React from "react";
import { Box, Flex, Image } from "rebass";

import "./Navbar.css";

function Navbar() {
  return (
    <Box p={5} fontSize={4} width={[1, 1, 1]} color="black" bg="blue">
      <Flex>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="green"
        >
          Donate
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="white"
        >
          About Us
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="yellow"
        >
          Ways to Give
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="orange"
        >
          Found an Animal?
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="red"
        >
          News & Events
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="green"
        >
          Donate
        </Box>
        <Box
          p={5}
          fontSize={2}
          width={[1 / 8, 1 / 8, 1 / 8]}
          height={[1 / 16, 1 / 16, 1 / 16]}
          color="black"
          bg="purple"
        >
          Contact Us
        </Box>
      </Flex>
    </Box>
  );
}

export default Navbar;
